using System.Collections.Generic;
using System.Linq;
using System.Text;
using Xunit;

namespace ChallengesTests.March2021Challenge
{
    public class OriginalDigitsChallnge : IChallenge
    {
        public string Link
            => "https://leetcode.com/explore/featured/card/march-leetcoding-challenge-2021/591/week-4-march-22nd-march-28th/3687/";

        [Theory]
        [InlineData("owoztneoer", "012")]
        [InlineData("fviefuro", "45")]
        [InlineData("zerozero", "00")]
        [InlineData("ereht", "3")]
        [InlineData("",
            "")]
        public void OriginalDigitsTests(string s, string expected)
        {
            Assert.Equal(expected, OriginalDigits(s));
        }
        
        public string OriginalDigits(string s)
        {
            var letters = new Dictionary<char, int>();

            var result = new List<int>();
            
            for (int i = 0; i < s.Length; i++)
            {
                if (!letters.ContainsKey(s[i]))
                    letters.Add(s[i],1);
                else
                    letters[s[i]]++;
            }
            
            result.AddRange(FindWords(letters));
            
            var resultSb = new StringBuilder();

            foreach (var i in result.OrderBy(x=>x))
            {
                resultSb.Append(i);
            }
            
            return resultSb.ToString();
        }

        private  List<int> FindWords(Dictionary<char,int> letters)
        {
            var result = new List<int>();
            
            var numbers = new List<Dictionary<char, int>>
            {
                new()
                {
                    {'z',1},
                    {'e',1},
                    {'r',1},
                    {'o',1}
                },
                new()
                {
                    {'o',1},
                    {'n',1},
                    {'e',1},
                },
                new()
                {
                    {'t',1},
                    {'w',1},
                    {'o',1},
                },
                new()
                {
                    {'t',1},
                    {'h',1},
                    {'r',1},
                    {'e',2},
                },
                new()
                {
                    {'f',1},
                    {'o',1},
                    {'u',1},
                    {'r',1},
                },
                new()
                {
                    {'f',1},
                    {'i',1},
                    {'v',1},
                    {'e',1},
                },
                new()
                {
                    {'s',1},
                    {'i',1},
                    {'x',1},
                },
                new()
                {
                    {'s',1},
                    {'e',2},
                    {'v',1},
                    {'n',1},
                },
                new()
                {
                    {'e',1},
                    {'i',1},
                    {'g',1},
                    {'h',1},
                    {'t',1},
                },
                new()
                {
                    {'n',2},
                    {'i',1},
                    {'e',1}
                }
            };

            var order = new List<int>
            {
                6, 4, 0, 2, 5, 1, 3, 7, 8, 9
            };
            
            for (int i = 0; i < order.Count; i++)
            {
                var foundWord = true;
                while (foundWord)
                {
                    foundWord = false;
                    
                    var containsNumber = true;
                    foreach (var letter in numbers[order[i]].Keys)
                    {
                        if (!letters.ContainsKey(letter) || letters[letter] < numbers[order[i]][letter])
                        {
                            containsNumber = false;
                            break;
                        }
                    }

                    if (containsNumber)
                    {
                        foundWord = true;
                        result.Add(order[i]);
                        foreach (var letter in numbers[order[i]].Keys)
                            letters[letter] -= numbers[order[i]][letter];
                    }
                }   
            }
            
            return result;
        }
    }
}